import { GET_ALL_BREEDS, GET_BREED_DETAILS, CREATE_BREED, DELETE_BREED } from "../actions/index.js";

const initialState = {
    breeds: [],
    temperaments: []
}


function rootReducer(state = initialState, actions) {
    console.log('soy el reducer', state);
    switch(actions.type){
        case GET_ALL_BREEDS:
            return {...state, breeds: actions.payload}
    }
}

export default rootReducer;
